let res = [];
for (let meet of $json.data) {
    const meeting_recommend = new Date(meet?.meetings_type?.meeting_recommend);
    const meeting_deadline = new Date(meet?.meetings_type?.meeting_deadline);
    const current_date = new Date()

    if (meeting_recommend < current_date && meeting_deadline > current_date) {
      if (meet.booked === null) {
        meet.booking_btn = 'yellow';
      }
      if (meet.reported === null) {
        meet.report_btn = 'yellow';
      }
      if (meet.s3_path === null) {
        meet.artifact_btn = 'yellow';
      }
    } else if (meeting_deadline < current_date) {
      if (meet.booked === null) {
        meet.booking_btn = 'red';
      }
      if (meet.reported === null) {
        meet.report_btn = 'red';
      }
    }
    else if (meeting_recommend > current_date) {
      if (meet.booked === null) {
        meet.booking_btn = 'gray';
      }
    }
  res.push(meet);
 }
return {res};

